export default class session{
    constructor() {
        this.data = null;
    }

    static getItem(key) {
        console.log(key)
        this.data = JSON.parse(window.sessionStorage.getItem(key));
        return this.data;
    }

    static setItem(key, value) {
        this.data = window.sessionStorage.Item(key, JSON.stringify(value));
        return this.data;
    }

}
